import React from 'react';

function CreateUser({ username, email, onChange, onCreate}){
    console.log('Createuser');
    return (
        <div>
            <input 
                name="username"
                placeholder="계정명" 
                onChange={onChange} 
                value={username}/>
            <input 
                name="email"
                placeholder="email" 
                onChange={onChange} 
                value={email}/>

            <button onClick={onCreate}>등록</button>
        </div>
    );
}

export default React.memo(CreateUser);
